import React from 'react';
import AppLayout from '../component/AppLayout';
import Head from 'next/head';

const Signup = () => {
  return (
    <>
      <Head>
        <title>회원 가입</title>
      </Head>
      <AppLayout>
        <div>회원 가입 페이지</div>
      </AppLayout>
    </>
  );
};

export default Signup;
